let BaseUrl = 'http://localhost:3004/posts/';
export function RestAPIPost(type, userData){

    console.log(BaseUrl);
    return new Promise((resolve, reject) => {

        // console.log(BaseUrl);
        fetch(BaseUrl+type,{
            method: 'POST',
            headers: {
              Accept: 'application/json',
              'Content-Type': 'application/json',
            },
            body: JSON.stringify(userData)
        })
        .then((response) => response.json())
        .then((responsejson) => {
            resolve(responsejson);
        })
        .catch((error) => {
            reject(error);
        })
        // console.log(BaseUrl);
    });
}

